import React from 'react';

const CommsCam = () => {
    const link = "http://127.0.0.1:5000/image_feed1"
    return (
        <div>
          <div className="row">
            <div className="col-md-6">
              <select style={{fontSize:'20px',}}> name="camera" id="camera" 
              <option value="volvo">Comms Cam</option>
              <option value="saab">Drivetrain Cam</option>
              </select>
              <img src={link} alt="Camera 1" />
            </div>
          </div>
        </div>
      );
};

export default CommsCam;
